import React from 'react';

import Input from '../../components/Input';
import TitlePage from '../TitlePage';


const Form = () => (
  <>
    <TitlePage>Login</TitlePage>
    <form>
    <Input
      type="email"
      placeholder="Digite seu e-mail"
      required
    />

    <Input
      type="password"
      placeholder="Digite sua senha"
      required
    />
  </form>
  </>
);

export default Form;
